import { useEffect, useState } from "react";

function UsageCreate() {
  const [items, setItems] = useState([]);
  const [itemName, setItemName] = useState("");
  const [usageType, setUsageType] = useState("USE");
  const [amount, setAmount] = useState("");
  const [date, setDate] = useState("");
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("/api/inventory/items")
      .then(res => res.json())
      .then(data => {
        if (Array.isArray(data)) {
          setItems(data);
          if (data.length > 0) {
            setItemName(data[0].itemName);
          }
        } else {
          console.error("❌ Items response is not array:", data);
          setItems([]);
        }
      })
      .catch(err => {
        console.error("❌ Failed to load items:", err);
        setItems([]);
      });
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage("");

    const payload = {
      name,
      usageType,
      amount: Number(amount)
    };

    if (date) payload.date = date;

    try {
      const res = await fetch("/api/inventory/usage", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(payload)
      });

      const data = await res.json();

      if (res.ok) {
        setMessage("✅ Usage recorded successfully");
        setAmount("");
        setDate("");
      } else {
        setMessage("❌ " + (data.error || "Failed to record usage"));
      }
    } catch (err) {
      console.error("❌ Network error:", err);
      setMessage("❌ Network error");
    }
  };

  return (
    <div style={{ maxWidth: 500 }}>
      <h2>Record Usage</h2>

      <form onSubmit={handleSubmit}>
        <label>Item</label>
        <br />
        <select
          value={itemName}
          onChange={e => setItemName(e.target.value)}
          required
        >
          {items.length === 0 && (
            <option value="">No items available</option>
          )}

          {items.map(item => (
            <option key={item.itemName} value={item.itemName}>
              {item.itemName}
            </option>
          ))}
        </select>

        <br /><br />

        <label>Usage Type</label>
        <br />
        <select
          value={usageType}
          onChange={e => setUsageType(e.target.value)}
        >
          <option value="USE">USE</option>
          <option value="WASTE">WASTE</option>
          <option value="RECEIVE">RECEIVE</option>
        </select>

        <br /><br />

        <label>Amount</label>
        <br />
        <input
          type="number"
          step="0.01"
          value={amount}
          onChange={e => setAmount(e.target.value)}
          required
        />

        <br /><br />

        <label>Date (optional)</label>
        <br />
        <input
          type="date"
          value={date}
          onChange={e => setDate(e.target.value)}
        />

        <br /><br />

        <button type="submit">Save</button>
      </form>

      {message && <p style={{ marginTop: 15 }}>{message}</p>}
    </div>
  );
}

export default UsageCreate;
